        width:'100%',
        backgroundColor:"red",
        marginTop:'2rem',
        padding:'1rem'
       }}
       >
       <ButtonGroup size="small" aria-label="small button group">
        {buttons}
      </ButtonGroup>
       </Box>
    )
}
export default ActivityDropdown;
